import React, { Component } from "react";

class Property extends Component {
  render() {
    return <h1>{this.getTotalValue}</h1>;
  }

  getTotalValue() {
    var sum = 0,
      i = 0;
    for (i = 0; i < this.props.assets.length; i++) {
      sum += this.props.assets[i];
    }
    console.log(sum);
    return sum;
  }
}

export default Property;
